"use client";

import React, { useState } from "react";
import { usePathname } from "next/navigation";
import SidebarMenu from "@/components/ui/menus/SidebarMenu";

/**
 * PixieNavbar component renders the navigation bar for the application.
 */
interface PixieNavbarProps {
  className?: string;
}

/**
 * Renders the PixieNavbar component.
 */
const PixieNavbar: React.FC<PixieNavbarProps> = ({ className = "" }) => {
  const pathname = usePathname();

  const hasHamburgerEnabled =
    !pathname?.includes("/login") && !pathname?.includes("/reset");
  const isLoginPage = pathname?.includes("/login");
  const isResetPage = pathname?.includes("/reset");

  const loginClassName = isLoginPage || isResetPage ? "mb-[33px]" : "";

  const [isMenuOpen, setIsMenuOpen] = useState<boolean>(false);
  const [timeoutId, setTimeoutId] = useState<NodeJS.Timeout | null>(null);

  /**
   * Handles mouse enter event to open the menu.
   */
  const handleMouseEnter = (): void => {
    if (hasHamburgerEnabled) {
      if (timeoutId) clearTimeout(timeoutId);
      setIsMenuOpen(true);
    }
  };

  /**
   * Handles mouse leave event to close the menu after a delay.
   */
  const handleMouseLeave = (): void => {
    if (hasHamburgerEnabled) {
      const id = setTimeout(() => {
        setIsMenuOpen(false);
      }, 200);
      setTimeoutId(id);
    }
  };

  return (
    <div className={`w-full ${loginClassName}`}>
      <div className={`w-full ${className} flex flex-col`}>
        <div className="flex justify-start items-center">
          <button
            type="button"
            className="relative w-fit"
            onMouseEnter={handleMouseEnter}
            onMouseLeave={handleMouseLeave}
            aria-expanded={isMenuOpen}
            aria-label="Toggle navigation menu"
            aria-haspopup="menu"
          >
            <div className="flex flex-row items-center mb-[4px]">
              <div
                className={`mr-3 hover:opacity-100 opacity-60${
                  isMenuOpen ? "!opacity-100" : ""
                } ${hasHamburgerEnabled ? "cursor-pointer" : "opacity-60"}`}
              >
                <div className="mt-[12px]">
                  {/* Please dont remove this. Check for safari webkit usage beforehand.*/}
                  <svg
                    width="139"
                    height="25"
                    viewBox="0 0 139 25"
                    fill="none"
                    xmlns="http://www.w3.org/2000/svg"
                    xmlnsXlink="http://www.w3.org/1999/xlink"
                  >
                    <rect
                      width="138.636"
                      height="25"
                      fill="url(#pattern0_2156_99)"
                    />
                    <defs>
                      <pattern
                        id="pattern0_2156_99"
                        patternContentUnits="objectBoundingBox"
                        width="1"
                        height="1"
                      >
                        <use
                          xlinkHref="#image0_2156_99"
                          transform="scale(0.00102459 0.00568182)"
                        />
                      </pattern>
                      <image
                        id="image0_2156_99"
                        width="976"
                        height="176"
                        preserveAspectRatio="none"
                        xlinkHref="data:image/png;base64,"
                      />
                    </defs>
                  </svg>
                </div>
              </div>
            </div>
            <SidebarMenu
              isOpen={isMenuOpen}
              onClose={() => setIsMenuOpen(false)}
            />
          </button>
        </div>
      </div>
    </div>
  );
};

export default PixieNavbar;
